      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 NOT BETWEEN ( + - col2 ) * - + 60 * + 65 + + col2 AND - 30 * col0;
  - name: tab1

outputs:
